function changeCreature(creature) {
    if (wildCreatureStats[creature] == null)
    creature = Object.keys(wildCreatureStats)[0];
    
    stats = wildCreatureStats[creature];
    var tableRows = '';
    for (var id in wildStatCalcStats) {
        if (stats[id + '1']) {
            var unit = '';
            if (id === 'damage')
            unit = ' [%]';
            tableRows += '<tr><td><a href="/' + wildStatCalcStats[id] + '">' + wildStatCalcStats[id] + unit + '</a></td><td><input type="number" min="' + stats[id + '1'] + '" max="100000" maxlength="6" step="0.1" value="' + stats[id + '1'] + '" id="wildStatCalc' + id + 'input" onchange="calcNatStats()" style="width:5em"></td><td id="wildStatCalc' + id + '"></td></tr>';
        }
    }
    tableRows += '<tr><td><a href="/Speed">Vitesse [%]</a></td><td title="Les créatures sauvages ont toujours 100% de vitesse">100</td><td id="wildStatCalcSpeed"></td></tr>';
    var creatureSelect = '<select onchange="changeCreature(this.value)">';
    for (var c in wildCreatureStats) {
        creatureSelect += '<option' + (c === creature ? ' sélectionnée' : '') + '>' + c + '</option>';
    }
    creatureSelect += '</select>';
    wildStatCalcDiv.innerHTML = '<table class="wikitable">' +
    '<tr><th colspan="3">' + creatureSelect + ' Niveau <input type="number" min="1" max="100000" maxlength="6" value="1" id="wildStatCalcLevelInput" onchange="calcNatStats()" style="width:5em"></th></tr>' +
    '<tr><th>Stat</th><th>Valeur</th><th>Gain de niveaux</th></tr>' +
    tableRows +
    '</table>';
    calcNatStats();
}

function calcNatStats() {
    // calcule selon le niveau
    if (stats) {
        var totallevel = 1; // 1 est le premier niveau
        var levels = [];
        var stat = 0;
        var levelEl = null;
        var percentile = '';
        var determinedStatsNr = 0;
        for (var id in wildStatCalcStats) {
            if (stats[id + '1']) {
                stat = document.getElementById('wildStatCalc' + id + 'input').value;
                if (stats[id + '1'] && stats[id + 'Inc'] && stat >= stats[id + '1']) {
                    var level = Math.round((stat - stats[id + '1']) / (stats[id + 'Inc'] * stats[id + '1']));
                    levels[id] = level;
                    levelEl = document.getElementById('wildStatCalc' + id);
                    levelEl.innerHTML = level;
                    if (level > 32)
                    percentile = 0.01;
                    else
                    percentile = percentiles[level];
                    levelEl.title = 'Ce niveau est parmi les ' + percentile + '% plus élevés comparés à toutes les créatures sauvages de niveau 120.';
                    totallevel += level;
                    determinedStatsNr++;
                }
            }
        }
        var levelInput = document.getElementById('wildStatCalcLevelInput').value;
        var speedPrefix = '';
        if (determinedStatsNr < 6)
        speedPrefix = '~';
        if (determinedStatsNr !== 7)
        document.getElementById('wildStatCalcSpeed').innerHTML = speedPrefix + Math.round((levelInput - totallevel) / (7 - determinedStatsNr));
        var hue = 0;
        for (var id in wildStatCalcStats) {
            if (stats[id + '1']) {
                hue = 0;
                if (totallevel > 1) {
                    hue = Math.round(120 * levels[id] / 28);
                }
                if (hue > 120)
                hue = 120;
                document.getElementById('wildStatCalc' + id).parentElement.style.backgroundColor = 'hsl(' + hue + ', 100%, 85%)';
            }
        }
    }
}